import React from 'react';
import { useState, useEffect, useRef } from 'react';
import "./LogIn.css";


function LogIn(){


    return(
        <div className="logInContainer">
            <h4>LogIn</h4>
            <img src={process.env.PUBLIC_URL + "childTransportLogo.png"}></img><br></br>
            <label for="userName">User Name:</label>
            <input type="text" placeholder="User Name" id="userName"></input><br></br>
            <label for="password">Password:</label>
            <input type="text" placeholder="Password" id="password"></input><br></br>
            <p><a href="www.google.com">Forgot Password?</a></p>  {/*onclick={} */}
            <button id="LogInBtn" type="button">LogIn</button>
            <p>Don't have an account?<a href="www.google.com">Forgot Password?</a></p>

        </div>
            )
}
export default LogIn;
